import React from "react";
import "./AuthStyle/Signupstyle.css";
import { TextField } from "@mui/material";
function Signup() {
  return (
    <>
      <div className="signup_container">
        <div className="signup_row">
          <form action="">
            <div className="input_box">
              <TextField
                className="input_box"
                label="Email Address"
                variant="standard"
              />
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Signup;
